import styled from '@emotion/styled'

export const Card = styled.div`
margin: 0px auto;
	width: 300px;
	background-color: rgb(250, 250, 250);
	border-radius: 5px;
	box-shadow: rgb(0 0 0 / 41%) 2px 3px 14px 2px;
	overflow: hidden;
`;
